        /// <summary>
        /// Get ListPlanoTrabalhoDataTransfer
        /// </summary>        
        public List<PlanoTrabalhoDataTransfer> GetListPlanoTrabalhoDataTransfer(int codEntidade, int codUsuario, int? codUnidade, int? codCarteira)
        {
            var listPlanoTrabalho = (codUnidade == 0 || !codUnidade.HasValue)
                 ? UowApplication.UowService.GetUowService<RelatorioPlanoTrabalhoService>().GetListRelatorioPlanoTrabalhoEntidade(codEntidade, codUsuario, codCarteira)
                 : UowApplication.UowService.GetUowService<RelatorioPlanoTrabalhoService>().GetListRelatorioPlanoTrabalhoUnidade(codEntidade, codUsuario, codUnidade.Value, codCarteira);

            List<PlanoTrabalhoDataTransfer> listPlanoTrabalhoDataTransfer = new List<PlanoTrabalhoDataTransfer>();

            foreach (var relatorioProjeto in listPlanoTrabalho.Where(r => r != null).ToList())
            {
                listPlanoTrabalhoDataTransfer.Add(MountPlanoTrabalhoDataTransfer(relatorioProjeto));
            }

            return listPlanoTrabalhoDataTransfer;
        }

        /// <summary>
        /// Mount PlanoTrabalhoDataTransfer
        /// </summary>        
        public PlanoTrabalhoDataTransfer MountPlanoTrabalhoDataTransfer(RelatorioPlanoTrabalhoDomain relatorioProjeto)
        {
            DateTime date2 = Convert.ToDateTime(relatorioProjeto.DataInicio, System.Globalization.CultureInfo.GetCultureInfo("pt-BR").DateTimeFormat);
            PlanoTrabalhoDataTransfer plano = new PlanoTrabalhoDataTransfer
            {
                CodigoProjeto = relatorioProjeto.CodigoProjeto,
                NomeProjeto = relatorioProjeto.NomeProjeto,
                NomeTipoProjeto = relatorioProjeto.TipoProjeto,
                DescObjetivo = relatorioProjeto.Objetivos,
                NomeUnidadeNegocio = relatorioProjeto.UnidadeNegocio,
                NomeResponsavelTecnico = relatorioProjeto.ResponsavelTecnico,
                NomeCarteiraPrincipal = relatorioProjeto.CarteiraPrincipal,
                DescPublicoAlvo = relatorioProjeto.PublicoAlvo,
                Observacao = relatorioProjeto.Observacao,
                DescClassificacao = relatorioProjeto.Classificacao,
                DescObjetivoEstrategico = relatorioProjeto.ObjetivoEstrategico,
                DescLinhaAcao = relatorioProjeto.LinhaAcao,
                DescAreaAtuacao = relatorioProjeto.AreaAtuacao,
                DescNatureza = relatorioProjeto.Natureza,
                DescFuncao = relatorioProjeto.Funcao,
                DescSubFuncao = relatorioProjeto.Subfuncao,
                DescPrograma = relatorioProjeto.Programa,                
                DtInicio = string.IsNullOrEmpty(relatorioProjeto.DataInicio) 
                                ? "--/--/----" 
                                : Convert.ToDateTime(relatorioProjeto.DataInicio, System.Globalization.CultureInfo.GetCultureInfo("pt-BR").DateTimeFormat).ToString("dd/MM/yyyy"),
                DtTermino = string.IsNullOrEmpty(relatorioProjeto.DataTermino) 
                                ? "--/--/----"
                                : Convert.ToDateTime(relatorioProjeto.DataTermino, System.Globalization.CultureInfo.GetCultureInfo("pt-BR").DateTimeFormat).ToString("dd/MM/yyyy"),
                ListItemRelatorio = GetListItemRelatorio(relatorioProjeto)
            };

            return plano;
        }

        /// <summary>
        /// Listar as entregas
        /// </summary>        
        private List<InfoListPageDataTransfer> GetListItemRelatorio(RelatorioPlanoTrabalhoDomain relatorioProjeto)
        {
            List<InfoListPageDataTransfer> listInfoList = new List<InfoListPageDataTransfer>();
            foreach (var entrega in relatorioProjeto.ListPlanoTrabalhoEntrega)
            {
                PlanoTrabalhoEntregaDataTransfer entregaDataTransfer = new PlanoTrabalhoEntregaDataTransfer();
                entrega.CopyProperties(ref entregaDataTransfer);                

                listInfoList.Add(new InfoListPageDataTransfer
                {
                    Item = entregaDataTransfer,
                    TipoItemList = TipoItemList.Entrega
                });
            }

            foreach (var atividadeEntrega in relatorioProjeto.ListPlanoTrabalhoAtividadeEntrega)
            {
                PlanoTrabalhoAtividadeEntregaDataTransfer atividadeEntregaDataTransfer = new PlanoTrabalhoAtividadeEntregaDataTransfer();
                atividadeEntrega.CopyProperties(ref atividadeEntregaDataTransfer);

                listInfoList.Add(new InfoListPageDataTransfer
                {
                    Item = atividadeEntregaDataTransfer,
                    TipoItemList = TipoItemList.AtividadeEntrega
                });
            }

            foreach (var produto in relatorioProjeto.ListPlanoTrabalhoProduto)
            {
                PlanoTrabalhoProdutoDataTransfer produtoDataTransfer = new PlanoTrabalhoProdutoDataTransfer
                {
                    Descricao = produto.Descricao
                };
                listInfoList.Add(new InfoListPageDataTransfer
                {
                    Item = produtoDataTransfer,
                    TipoItemList = TipoItemList.Produto
                });
            }

            foreach (var resultado in relatorioProjeto.ListPlanoTrabalhoResultadoEsperado)
            {
                PlanoTrabalhoResultadoEsperadoDataTransfer resultadoDataTransfer = new PlanoTrabalhoResultadoEsperadoDataTransfer
                {
                    DscMeta = resultado.Meta,
                    NomeIndicador = resultado.Indicador,
                    NomeTransformacao = resultado.Transformacao,
                    StrDtPrazo = resultado.Prazo.HasValue ? resultado.Prazo.Value.ToString("dd/MM/yyyy") : ""
                };
                listInfoList.Add(new InfoListPageDataTransfer
                {
                    Item = resultadoDataTransfer,
                    TipoItemList = TipoItemList.ResultadoEsperado
                });
            }

            return listInfoList;
        }
        

        /// <summary>
        /// Buscar o array de byte do pdf do plano de trabalho 
        /// </summary>        
        public byte[] GetByteArrayPdfStreamRelatorioPlanoTrabalho(int codEntidade, int codUsuario, int? codUnidade, int? codCarteira)
        {
            List<string> listHtmlPage = new List<string>();
            List<PlanoTrabalhoDataTransfer> listPlano = GetListPlanoTrabalhoDataTransfer(codEntidade, codUsuario, codUnidade, codCarteira);

            int numPagina = 1;
            foreach (PlanoTrabalhoDataTransfer plano in listPlano)
            {
                //Montar html das páginas da parte de info do PROJETO                    
                List<int> listNumPagInfo = plano.InfoGrupoItemPage.ListItemPage.Select(p => p.NumPage).Distinct().OrderBy(p => p).ToList();
                foreach (var numPaginaProjeto in listNumPagInfo)
                {
                    string htmlPage = GetPageHtmlInfoProjeto(plano.InfoGrupoItemPage, numPaginaProjeto);
                    listHtmlPage.Add(GetPageHtml(htmlPage, numPagina.ToString().PadLeft(2, '0'), plano.NomeProjeto, plano.NomeUnidadeNegocio));
                    numPagina++;
                }

                //Montar html das páginas das listas do PROJETO                
                if (plano.ListItemRelatorio.Any())
                {
                    int numItensPorPagina = 20;
                    int qtdPaginas = Math.Abs(plano.ListItemRelatorio.Count / numItensPorPagina);
                    for (int page = 0; page <= qtdPaginas; page++)
                    {
                        string strNumPage = (page + 1).ToString().PadLeft(2, '0');
                        var listItemPorPagina = plano.ListItemRelatorio
                          .Skip(numItensPorPagina * page)
                          .Take(numItensPorPagina)
                          .ToList();

                        string pageHtmlList = GetPageHtmlInfoLista(listItemPorPagina);
                        listHtmlPage.Add(GetPageHtml(pageHtmlList, numPagina.ToString().PadLeft(2, '0'), plano.NomeProjeto, plano.NomeUnidadeNegocio));
                        numPagina++;
                    }
                }
            }

            listHtmlPage = listHtmlPage.Select(t => t.Replace("countTotalPage", (numPagina - 1).ToString().PadLeft(2, '0'))).ToList();
            return Infra.Core.Pdf.PdfCore.GetStreamPageFromListHtmlPageSizeA4PortraitMargin5(listHtmlPage).ToByteArray();
        }
        
