        /// <summary>
        /// Get PageHtmlInfoProjeto
        /// </summary>        
        private string GetPageHtmlInfoProjeto(InfoGrupoItemPageDataTransfer infoGrupo, int numPage)
        {
            StringBuilder sb = new StringBuilder();
            sb.Append("<table style='" + _styleTable + "'>");
            sb.Append("<thead>");
            sb.Append("<tr>");
            sb.Append("<th colspan='3' style='" + _styleThFundoVerde + "'>Informações do Projeto</th>");
            sb.Append("</tr>");
            sb.Append("</thead>");
            sb.Append("<tbody>");

            List<int> listNumGrupoInclusos = new List<int>();

            foreach (var item in infoGrupo.ListItemPage.Where(p => p.NumPage == numPage).OrderBy(p => p.NumOrdem).ToList())
            {
                if (item.NumGrupo == 1 && !listNumGrupoInclusos.Any(g => g == 1))
                {
                    sb.Append("<tr>");
                    sb.Append("<th colspan='2' style='" + _styleThFundoCinza + "'>Nome do projeto</th>");
                    sb.Append("<th style='" + _styleThFundoCinza + "'>Tipo de Projeto</th>");
                    sb.Append("</tr>");
                    sb.Append("<tr>");
                    sb.Append("<td colspan='2' style='" + _stylePadding5 + "'>" + infoGrupo["NomeProjeto"].Valor + "</td>");
                    sb.Append("<td style='" + _stylePadding5 + "'>" + infoGrupo["TipoProjeto"].Valor + "</td>");
                    sb.Append("</tr>");

                    listNumGrupoInclusos.Add(1);
                }

                if (item.NumGrupo == 2 || item.NumGrupo == 4)
                {
                    sb.Append(MountHtmlItemRowTable(item.DescTitulo, item.Valor));
                }

                if (item.NumGrupo == 3 && !listNumGrupoInclusos.Any(g => g == 3))
                {
                    sb.Append("<tr>");
