            /// <summary>
            /// 
            /// </summary>        
            public byte[] GetByteArrayPdfStreamRelatorioPlanoTrabalhoNew(int codEntidade, int codUsuario, int? codUnidade, int? codCarteira, string nomeUnidade, string nomeCarteira, string nomeEntidade)
            {
                List<string> listHtmlPage = new List<string>();
                List<PlanoTrabalhoDataTransfer> listPlano = GetListPlanoTrabalhoDataTransfer(codEntidade, codUsuario, codUnidade, codCarteira);
                DateTime dtAtual = DateTime.Now;
                string anoRelatorio = dtAtual.Year.ToString();
                string mesRelatorio = System.Globalization.DateTimeFormatInfo.CurrentInfo.GetMonthName(dtAtual.Month).ToUpper();

                listHtmlPage.Add(GetHtmlCapa(anoRelatorio, mesRelatorio, nomeUnidade, nomeCarteira, nomeEntidade));
                int numPagina = 1;
                
                foreach (var plano in listPlano)
                {
                    string htmlTabelaCaracterizacao = GetHtmlTabelaCaracterizacao(plano.NomeTipoProjeto, plano.NomeProjeto, plano.DescObjetivo , plano.NomeUnidadeNegocio, plano.NomeResponsavelTecnico, plano.NomeCarteiraPrincipal);
                    string paginaCaracterizacao = GetHtmlPaginaPadrao(htmlTabelaCaracterizacao, numPagina.ToString().PadLeft(2,'0'), plano.NomeProjeto, plano.NomeUnidadeNegocio);
                    listHtmlPage.Add(paginaCaracterizacao);
                    numPagina++;

                    string htmlTabelaInformacoesGerais = GetHtmlTabelaInformacoesGerais(plano.NomeTipoProjeto, 
                                                                                        plano.DtInicio, 
                                                                                        plano.DtTermino, 
                                                                                        plano.DescPublicoAlvo, 
                                                                                        plano.DescObjetivoEstrategico, 
                                                                                        plano.DescLinhaAcao, 
                                                                                        plano.DescAreaAtuacao, 
                                                                                        plano.DescNatureza, 
                                                                                        plano.DescFuncao, 
                                                                                        plano.DescSubFuncao, 
                                                                                        plano.DescPrograma, 
                                                                                        plano.Observacao);

                    string paginaInformacoesGerais = GetHtmlPaginaPadrao(htmlTabelaInformacoesGerais, numPagina.ToString().PadLeft(2, '0'), plano.NomeProjeto, plano.NomeUnidadeNegocio);
                    listHtmlPage.Add(paginaInformacoesGerais);
                    numPagina++;
               

                //Montar html das páginas das listas do PROJETO                
                if (plano.ListItemRelatorio.Any())
                {
                    int numItensPorPagina = 15;
                    int qtdPaginas = Math.Abs(plano.ListItemRelatorio.Count / numItensPorPagina);
                    for (int page = 0; page <= qtdPaginas; page++)
                    {
                        string strNumPage = (page + 1).ToString().PadLeft(2, '0');
                        var listItemPorPagina = plano.ListItemRelatorio
                          .Skip(numItensPorPagina * page)
                          .Take(numItensPorPagina)
                          .ToList();

                        if(listItemPorPagina.Any())
                        {
                            string pageHtmlList = GetPageHtmlInfoLista(listItemPorPagina);
                            listHtmlPage.Add(GetHtmlPaginaPadrao(pageHtmlList, numPagina.ToString().PadLeft(2, '0'), plano.NomeProjeto, plano.NomeUnidadeNegocio));
                            numPagina++;
                        }                        
                    }
                }
            }

                listHtmlPage = listHtmlPage.Select(t => t.Replace("countTotalPage", numPagina.ToString().PadLeft(2, '0'))).ToList();
                return Infra.Core.Pdf.PdfCore.GetStreamPageFromListHtmlPageSizeA4PortraitMargin5(listHtmlPage).ToByteArray();
            }

            public string GetHtmlPaginaPadrao(string htmlPageData, string strNumPage, string nomeProjeto, string nomeUnidade)
            {
                    StringBuilder sb = new StringBuilder();

                    sb.Append("<html><body style='overflow: auto; height: 100 %;'>");
                    sb.Append("<div style='height:98vh; overflow-y:scroll;margin-top: 10px;position: fixed; top: 0mm; width: 100%; text-align: right;'>");
                    sb.Append("<table style='margin-top:10px; font-family: Trebuchet MS, Arial, Helvetica, sans-serif;border-collapse: collapse;width:100%;'>");

                    sb.Append("<tr>");
                    sb.Append("<td width='60%'>");
                    sb.Append(MountInfoTitle(nomeProjeto, nomeUnidade));
                    sb.Append("</td>");
                    sb.Append("<td style='text-align: right;' width='40%'>");
                    sb.Append(MountInfoGeracaoLogoRelatorioImgBase64(strNumPage));
                    sb.Append("</td>");
                    sb.Append("</tr>");

                    sb.Append("<tr>");
                    sb.Append("<td style='text-align: left;padding-left:30px;padding-right:5px;' colspan='2'>");
                    sb.Append(htmlPageData);
